import React from "react";
import './JobHistory.css';

export default () => {
  return (
    <div className="component third-component">
      <div className="contentJobHistory">
        <h1>Job history</h1>
        <div className="infoTable infoTable--3cols" >
            <div className="infoTable-cell"><strong>Wipro Ltd: </strong></div>
            <div className="infoTable-cell">Project Engineer (Current Account: ANZ Wealth)</div>
            <div className="infoTable-cell">From June 2019 to Present</div>

            <div className="infoTable-cell"><strong>Telstra: </strong></div>
            <div className="infoTable-cell">Automation Specialist Intern</div>
            <div className="infoTable-cell">Winter Break in 2017 (Month of July)</div>

            <div className="infoTable-cell"><strong>Smithies Pizzeria: </strong></div>
            <div className="infoTable-cell">Kitchen Hand</div>
            <div className="infoTable-cell">From August 2012 to March 2013.</div>

            <div className="infoTable-cell"><strong>Body Corporate at Food Works: </strong></div>
            <div className="infoTable-cell">Grounds Keeping</div>
            <div className="infoTable-cell">From April 2011 to December 2012.</div>

          </div>
      </div>
    </div>
  );
};
